import React from 'react';
import { Link } from 'react-router-dom';
import logo from '../assests/logo.png'; // Assuming you have a logo image
import settingsIcon from '../assests/settings.png'; // Assuming you have a settings icon
import styles from '../styles/Home.module.css';

export default function Home() {
  return (
    <div className={styles.container}>
      {/* Header */}
      <header className={styles.header}>
        <div className={styles.logoSection}>
          <img src={logo} alt="Logo" className={styles.logo} />
          <h1 className={styles.siteName}>My Application</h1>
        </div>
        <div className={styles.settingsSection}>
          <img src={settingsIcon} alt="Settings" className={styles.settingsIcon} />
          <div className={styles.dropdown}>
            <ul>
              <li><Link to="/profile">Profile</Link></li>
              <li><Link to="/signout">Sign Out</Link></li>
            </ul>
          </div>
        </div>
      </header>

      {/* Middle Section */}
      <main className={styles.main}>
        <h2 className={styles.mainTitle}>Welcome to My Application</h2>
        <div className={styles.links}>
          <Link className={styles.link} to="/register_component">Register Component</Link>
          <Link className={styles.link} to="/remove_component">Remove Component</Link>
          <Link className={styles.link} to="/serialnumber_generation">Serial Number Generation</Link>
        </div>
      </main>

      {/* Footer */}
      <footer className={styles.footer}>
        <div className={styles.footerLeft}>
          <p>This is a sample application for managing components and generating serial numbers. You can register, remove, or generate serial numbers using the links above.</p>
        </div>
        <div className={styles.footerRight}>
          <p>Contact Info: contact@myapplication.com</p>
        </div>
      </footer>
    </div>
  );
}
